import React from 'react'



const BASE_URL = 'https://rickandmortyapi.com/api/';




export default class Nation extends React.Component {

    //start - Multiple api calls
    fetchData = () => {

        const urls = [
        "https://maps.googleapis.com/maps/api/geocode/json?latlng=40.714224,-73.961452&key=AIzaSyD8g2ang82_R7aQG8AdVAJg4jkQ52-cp4E",
        "hhttps://maps.googleapis.com/maps/api/geocode/json?latlng=40.714224,-73.961452&key=AIzaSyD8g2ang82_R7aQG8AdVAJg4jkQ52-cp4E",
        "https://maps.googleapis.com/maps/api/geocode/json?latlng=40.714224,-73.961452&key=AIzaSyD8g2ang82_R7aQG8AdVAJg4jkQ52-cp4E"
        ];
    
        const allRequests = urls.map(url => 
        fetch(url).then(response => response.json())
        );
    
        return Promise.all(allRequests);
    }



    //end

    state = {
      loading: true,
      person: null
    };
  
    async componentDidMount() {
      const url = "https://maps.googleapis.com/maps/api/geocode/json?latlng=40.714224,-73.961452&key=AIzaSyD8g2ang82_R7aQG8AdVAJg4jkQ52-cp4E";
      const response = await fetch(url);
      const data = await response.json();

      this.setState({ person: data.results[0].address_components[6], loading: false });
    }
  
    render() 
    {
      if (this.state.loading) {
        return <div>loading...</div>;
      }
  
      if (!this.state.person) {
        return <div>didn't get a person</div>;
      }
  
      return (
        <div>
          <div>{this.state.person.long_name}</div>
          <div>{this.props.data.downloads[1].app_id}.</div>

          {fetchData().then(arrayOfResponses => console.log("The data we got from the server:", arrayOfResponses))}
        </div>
      );
    }
  }
